import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="header-left">
        <h1>Seller-Dashboard</h1>
      </div>
      <div className="header-right">
        <button className="invite-button">Invite</button>
      </div>
    </header>
  );
};

export default Header;
